import React, { useState } from 'react';
import './App.css';

const App: React.FC = () => {
  const [inputText, setInputText] = useState<string>('');
  const [outputText, setOutputText] = useState<string>('');

  const parseText = (text: string): Record<string, any> => {
    const lines = text.split('\n');
    const result: Record<string, any> = {};

    lines.forEach((line) => {
      const [key, ...valueParts] = line.split(':').map((part) => part.trim());
      if (key && valueParts.length > 0) {
        const value = valueParts.join(':').replace(/^"|"$/g, ''); // Remove wrapping quotes
        result[key] = isNaN(Number(value)) ? value : Number(value); // Convert to number if applicable
      }
    });

    return result;
  };

  const handleParse = () => {
    const parsedObject = parseText(inputText);
    setOutputText(JSON.stringify(parsedObject, null, 2)); // Pretty-print JSON
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1>Text Parser</h1>
      <textarea
        value={inputText}
        onChange={(e) => setInputText(e.target.value)}
        placeholder="Paste your text here"
        style={{
          width: '100%',
          height: '150px',
          marginBottom: '10px',
          fontFamily: 'monospace',
        }}
      />
      <button onClick={handleParse} style={{ marginBottom: '10px', padding: '10px 20px' }}>
        Parse Text
      </button>
      <textarea
        value={outputText}
        readOnly
        placeholder="Output will appear here"
        style={{
          width: '100%',
          height: '150px',
          fontFamily: 'monospace',
        }}
      />
    </div>
  );
};

export default App;
